import Shop_Data from "./shop.data.js";

import ShopActionTypes from "./shop.types";

const INITIAL_STATE = {
  SHOP_DATA: Shop_Data,
};

const shopReducer = (state = INITIAL_STATE, action) => {
  switch (action.type) {
    case ShopActionTypes.
    default:
      return state;
  }
};

export default shopReducer;
